INSERT INTO "steps" VALUES(58,'Supply List - Sand Paper, Paint Brush, Paint, Damp Rag, Screwdriver, Floor Protection','2014-05-19 23:22:32.013381','2014-05-23 01:43:00.108088',11,108,'Great Heading!! ');
INSERT INTO "steps" VALUES(59,'Carefully remove any existing hardware.','2014-05-19 23:26:50.568015','2014-05-23 01:43:14.795611',11,108,'');
INSERT INTO "steps" VALUES(60,'Prep surface for paintings:  lightly sand surface of furniture.  I used 50 grit sanding block from Home Depot for $1.93.','2014-05-19 23:31:24.831598','2014-05-19 23:31:24.831598',11,108,NULL);
INSERT INTO "steps" VALUES(61,'Wipe clean with very lightly dampened rag.  Let dry for a few moments.  Re-sand and wipe clean again.  Roughening up the smooth laminate surface will ensure your paint sticks!','2014-05-19 23:33:26.733117','2014-05-19 23:33:26.733117',11,108,NULL);
INSERT INTO "steps" VALUES(62,'Apply first coat of paint using an interior/exterior paint and primer in one with a flat finish and let dry using manufacturers directed drying time.  Use light brush strokes so that you avoid thicker paint in areas.  I used a 1 1/2" brush since my shelf is small, you can use a larger or small brush size depending on your surface area.  The brush shown cost $3.45 at Home Depot.','2014-05-19 23:37:04.802583','2014-05-19 23:44:30.705608',11,108,NULL);
INSERT INTO "steps" VALUES(63,'Apply the second coat of paint and let dry according to manufacturers directions.  I let dry for two hours.','2014-05-19 23:41:59.927212','2014-05-19 23:41:59.927212',11,108,NULL);
INSERT INTO "steps" VALUES(64,'Reinstall hardware or add your own new and exciting hardware from Cost Plus World Market!  And YOU''RE DONE!  CONGRATULATIONS!  Send me pictures of your new and improved laminated furniture!  Thanks y''all!','2014-05-19 23:47:44.781872','2014-05-19 23:47:44.781872',11,108,NULL);
INSERT INTO "steps" VALUES(65,'Gather Forks and Clamps necessary to bend Forks!','2014-05-20 00:45:52.044882','2014-05-21 23:05:33.898130',11,109,'Acquire Supplies');
INSERT INTO "steps" VALUES(66,'Bend the Forks just below the neck and then again about midway on the stem.  Fork should have about 2 inches of flat surface to lay flat! ','2014-05-20 00:46:30.508135','2014-05-21 23:09:57.787986',11,109,'Put in the Elbow Grease! ');
INSERT INTO "steps" VALUES(67,'With plyers, round the edge of the outside fork prong to give it a rustic look. ','2014-05-20 00:47:08.151018','2014-05-21 23:10:19.734696',11,109,'Intricate Bending');
