BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" text NOT NULL);
CREATE TABLE "users" ("id" SERIAL PRIMARY KEY NOT NULL, "email" text DEFAULT '' NOT NULL, "encrypted_password" text DEFAULT '' NOT NULL, "reset_password_token" text, "reset_password_sent_at" timestamp, "remember_created_at" timestamp, "sign_in_count" integer DEFAULT 0, "current_sign_in_at" timestamp, "last_sign_in_at" timestamp, "current_sign_in_ip" text, "last_sign_in_ip" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "name" text, "admin" boolean, "refresh_token" text, "access_token" text, "expires" text, "google_uid" text);
CREATE TABLE "pins" ("id" SERIAL PRIMARY KEY NOT NULL, "description" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "user_id" integer, "image_file_name" text, "image_content_type" text, "image_file_size" integer, "image_updated_at" timestamp, "image_remote_url" text, "cost" float, "hours" integer, "pin_heading" text);
CREATE TABLE "stores" ("id" SERIAL PRIMARY KEY NOT NULL, "name" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "store_image_file_name" text, "store_image_content_type" text, "store_image_file_size" integer, "store_image_updated_at" timestamp);
CREATE TABLE "store_admins" ("id" SERIAL PRIMARY KEY NOT NULL, "email" text DEFAULT '' NOT NULL, "encrypted_password" text DEFAULT '' NOT NULL, "reset_password_token" text, "reset_password_sent_at" timestamp, "remember_created_at" timestamp, "sign_in_count" integer DEFAULT 0, "current_sign_in_at" timestamp, "last_sign_in_at" timestamp, "current_sign_in_ip" text, "last_sign_in_ip" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "groups" ("id" SERIAL PRIMARY KEY NOT NULL, "description" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "image_file_name" text, "image_content_type" text, "image_file_size" integer, "image_updated_at" timestamp);
CREATE TABLE "comments" ("id" SERIAL PRIMARY KEY NOT NULL, "commentable_id" integer DEFAULT 0, "commentable_type" text DEFAULT '', "title" text DEFAULT '', "body" text DEFAULT '', "subject" text DEFAULT '', "user_id" integer DEFAULT 0 NOT NULL, "parent_id" integer, "lft" integer, "rgt" integer, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "steps" ("id" SERIAL PRIMARY KEY NOT NULL, "description" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "user_id" integer, "pin_id" integer, "step_title" text);
CREATE TABLE "step_images" ("id" SERIAL PRIMARY KEY NOT NULL, "created_at" timestamp, "updated_at" timestamp, "step_id" integer, "user_id" integer, "image_file_name" text, "image_content_type" text, "image_file_size" integer, "image_updated_at" timestamp, "description" text, "pin_id" integer);
CREATE TABLE "pin_images" ("id" SERIAL PRIMARY KEY NOT NULL, "description" text, "created_at" timestamp, "updated_at" timestamp, "pin_id" integer, "user_id" integer, "image_file_name" text, "image_content_type" text, "image_file_size" integer, "image_updated_at" timestamp);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
CREATE INDEX "index_pins_on_user_id" ON "pins" ("user_id");
CREATE UNIQUE INDEX "index_store_admins_on_email" ON "store_admins" ("email");
CREATE UNIQUE INDEX "index_store_admins_on_reset_password_token" ON "store_admins" ("reset_password_token");
CREATE INDEX "index_comments_on_user_id" ON "comments" ("user_id");
CREATE INDEX "index_comments_on_commentable_id_and_commentable_type" ON "comments" ("commentable_id", "commentable_type");
CREATE INDEX "index_steps_on_user_id" ON "steps" ("user_id");
CREATE INDEX "index_steps_on_pin_id" ON "steps" ("pin_id");
CREATE INDEX "index_pin_images_on_pin_id" ON "pin_images" ("pin_id");
CREATE INDEX "index_step_images_on_step_id" ON "step_images" ("step_id");
CREATE INDEX "index_pin_images_on_user_id" ON "pin_images" ("user_id");
CREATE INDEX "index_step_images_on_user_id" ON "step_images" ("user_id");
COMMIT;
